import React, { useState, useEffect } from "react";
import ProductDataService from "../Services/Barcelparts.js"


const Research_Page = function (products_to_display) {

  const [products, setProducts] = useState([]);


  const getAll = () => {
    ProductDataService.getAll()
      .then(response => {
        console.log(response.data);
        setProducts(response.data.products);
      })
      .catch(e => {
        console.log(e);
      });
  };


  return (
   <div className="container-md">
     <br></br>
      <div className="row">
        {products_to_display.products.map((products) => {
          return (
            <div className="row row-cols-2 row-cols-md-3 row-cols-lg-6">
              <div className="card">
                <div className="card-body">
                  <h5 className="card-title">{products.Design}</h5>
                  <p className="card-text">
                    <strong>Producer: </strong>{products.Marca}<br />
                    <strong>Price: </strong>{products.PrecoCusto}<br />
                  </p>
                </div>
              </div>
            </div>
          );
        })
        }
      </div>
    </div>
  );
}


export default Research_Page;
